org.jenkinsci.plugins.pipeline.modeldefi.value:
def yamlFile = "${BUILD_CONFIG_DIR}/${BUILD_KIND}BuildSettings.yaml" def script = $/eval "cat ${yamlFile} | grep -o 'productName: .*$' | sed -e 's/productName: ''//'"/$ PRODUCT_NAME = sh(script:"${script}", returnStdout:true) PRODUCT_NAME = PRODUCT_NAME.replaceAll("\n", "") println '-------- PRODUCT_NAME:' + PRODUCT_NAME
script = $/eval "cat ${yamlFile} | grep -o 'cfBundleName: .*$' | sed -e 's/cfBundleName: ''//'"/$ IPA_FILENAME = sh(script:"${script}", returnStdout:true) IPA_FILENAME = IPA_FILENAME.replaceAll("\n", "") println '-------- IPA_FILENAME:' + IPA_FILENAME
APP_OUTPUT_PATH = "$OUTPUT_PATH/Export/Apps/${IPA_FILENAME}.ipa" println '-------- APP_OUTPUT_PATH:' + APP_OUTPUT_PATH
script = $/eval "cat ${yamlFile} | grep -o 'cfBundleExecutableName: .*$' | sed -e 's/cfBundleExecutableName: ''//'"/$ IPA_EXECUTABLE_NAME = sh(script:"${script}", returnStdout:true) IPA_EXECUTABLE_NAME = IPA_EXECUTABLE_NAME.replaceAll("\n", "") println '-------- IPA_EXECUTABLE_NAME:' + IPA_EXECUTABLE_NAME
yamlFile = "${BUILD_CONFIG_DIR}/AddressablesProfileSettings.yaml" script = $/eval "cat ${yamlFile} | grep -o 'Profile${AssetKind}: .*$' | sed -e 's/Profile${AssetKind}: ''//'"/$ ASSET_PROFILE = sh(script:"${script}", returnStdout:true) ASSET_PROFILE = ASSET_PROFILE.replaceAll("\n", "") println '-------- ASSET_PROFILE:' + ASSET_PROFILE
// キャッシュ削除が必要な場合Libraryフォルダーを削除 if (params.CLEAR_CACHE) { dir(env.LIBRARY_PATH) { deleteDir() } }
// ビルド前に出力ディレクトリの削除 dir(env.OUTPUT_PATH) { deleteDir() }

execution.script:
pipeline {
    agent {
        label "DevBuild_JobNode"
    }
    environment {
        // BRANCHとRELEASENOTEはジョブのパラメーターつきビルドで設定される

        // git
        GIT_URL='https://git-1.cocone.jp/projectp3/p3-client'
        GIT_P3_URL='https://git-1.cocone.jp/projectp3/p3-assets'
        GIT_CREDENTIAL='jenkins_gitlab'

        // environment values
        UNITY_PATH="/Applications/Unity/Hub/Editor/${UNITY_VERSION}/Unity.app/Contents/MacOS/Unity"
        UNITY_METHOD='Cocone.ProjectP3.Client.Build'
        ADDRESSABLE_METHOD='Cocone.ProjectP3.BuildAddressableAssets.BatchBuild'

        // build configuration
        BUILD_TARGET='iOS'
        PRODUCT_NAME=''
        VERSION=""
        OUTPUT_PATH='build_ios'
        BUILD_KIND='Alpha'
        IPA_FILENAME=''
        IPA_EXECUTABLE_NAME=''
        BUILD_CONFIG_DIR='Assets/App/Editor/Build/Configs'
        EXPORT_PLIST_DIR='${BUILD_CONFIG_DIR}/iOS'
        APP_OUTPUT_PATH=''

        // s3 upload variables
        UPLOAD_S3_ADDRESS=''
        ASSET_BUILDPATH=''
        SERVER_PROFILE_NAME=''

        // appcenter
        APPCENTER_API_TOKEN='3950f9fbd18dd8e2d18cb970933d125115bf6a67'
        APPCENTER_OWNER='coconecorp'
        APPCENTER_APPNAME='Pokepia-iOS'
        APPCENTER_GROUPS='COCONE-QA, Collaborators, POKETRIA Members'

        // slack
        SLACK_DOMAIN='cocone'
        SLACK_CHANNEL='p3_jenkins'
    }

    stages {
        stage('Git') {
            steps {
                script{
                    def cause = currentBuild.getBuildCauses('hudson.model.Cause$UserIdCause')
                    USERNAME = cause.userName
                }

                checkout([$class: 'GitSCM',
                    branches: [[name: "$BRANCH"]],
                    extensions: [
                        [$class: 'CloneOption', timeout: 60],
                        [$class: 'CheckoutOption', timeout: 60]
                    ],
                    gitTool: 'Default',
                    userRemoteConfigs: [[credentialsId: "$GIT_CREDENTIAL", url: "$GIT_URL"]]
                ])

                // Git-LFSの値を反映させるための処理
                sh 'git lfs pull'
                sh 'git rm --cached -r .'
                sh 'git reset --hard'
                sh 'git rm .gitattributes'
                sh 'git reset .'

                checkout([$class: 'GitSCM',
                    branches: [[name: "$BRANCH"]],
                    extensions: [
                        [$class: 'CloneOption', timeout: 60],
                        [$class: 'CheckoutOption', timeout: 60]
                    ],
                    gitTool: 'Default',
                    userRemoteConfigs: [[credentialsId: "$GIT_CREDENTIAL", url: "$GIT_URL"]]
                ])
            }
        }
        stage('yaml取得/初期化') {
            steps {
                script {
                    def yamlFile = "${BUILD_CONFIG_DIR}/${BUILD_KIND}BuildSettings.yaml"
                    def script = $/eval "cat ${yamlFile} | grep -o 'productName: .*$' | sed -e 's/productName: ''//'"/$
                    PRODUCT_NAME = sh(script:"${script}", returnStdout:true)
                    PRODUCT_NAME = PRODUCT_NAME.replaceAll("\n", "")
                    println '-------- PRODUCT_NAME:' + PRODUCT_NAME

                    script = $/eval "cat ${yamlFile} | grep -o 'cfBundleName: .*$' | sed -e 's/cfBundleName: ''//'"/$
                    IPA_FILENAME = sh(script:"${script}", returnStdout:true)
                    IPA_FILENAME = IPA_FILENAME.replaceAll("\n", "")
                    println '-------- IPA_FILENAME:' + IPA_FILENAME

                    APP_OUTPUT_PATH = "$OUTPUT_PATH/Export/Apps/${IPA_FILENAME}.ipa"
                    println '-------- APP_OUTPUT_PATH:' + APP_OUTPUT_PATH

                    script = $/eval "cat ${yamlFile} | grep -o 'cfBundleExecutableName: .*$' | sed -e 's/cfBundleExecutableName: ''//'"/$
                    IPA_EXECUTABLE_NAME = sh(script:"${script}", returnStdout:true)
                    IPA_EXECUTABLE_NAME = IPA_EXECUTABLE_NAME.replaceAll("\n", "")
                    println '-------- IPA_EXECUTABLE_NAME:' + IPA_EXECUTABLE_NAME


                    yamlFile = "${BUILD_CONFIG_DIR}/AddressablesProfileSettings.yaml"
                    script = $/eval "cat ${yamlFile} | grep -o 'Profile${AssetKind}: .*$' | sed -e 's/Profile${AssetKind}: ''//'"/$
                    ASSET_PROFILE = sh(script:"${script}", returnStdout:true)
                    ASSET_PROFILE = ASSET_PROFILE.replaceAll("\n", "")
                    println '-------- ASSET_PROFILE:' + ASSET_PROFILE

                    // キャッシュ削除が必要な場合Libraryフォルダーを削除
                    if (params.CLEAR_CACHE)
                    {
                        dir(env.LIBRARY_PATH) {
                            deleteDir()
                        }
                    }

                    // ビルド前に出力ディレクトリの削除
                    dir(env.OUTPUT_PATH) {
                        deleteDir()
                    }
                }
            }
        }
        stage('Assets') {
            steps {
                script {
                    StringBuilder commandBuilder = new StringBuilder()
                    commandBuilder.append "$UNITY_PATH"
                    commandBuilder.append " -projectPath $WORKSPACE"
                    commandBuilder.append " -quit -batchmode"
                    commandBuilder.append " -executeMethod $ADDRESSABLE_METHOD"
                    commandBuilder.append " -logFile ${WORKSPACE}/Logs/assetbuild_${BUILD_ID}_log.txt"
                    commandBuilder.append " -buildTarget $BUILD_TARGET"
                    commandBuilder.append " -assetProfile $ASSET_PROFILE"

                    sh(script:commandBuilder.toString(), returnStdout:false)
                }
            }
        }
        stage('Unity') {
            options {
                timeout(time: 2, unit: 'HOURS')
            }
            steps {
                script {
                    StringBuilder commandBuilder = new StringBuilder()
                    commandBuilder.append "$UNITY_PATH"
                    commandBuilder.append " -projectPath $WORKSPACE"
                    commandBuilder.append " -quit -batchmode"
                    commandBuilder.append " -executeMethod $UNITY_METHOD"
                    commandBuilder.append " -logFile ${WORKSPACE}/Logs/build_${BUILD_ID}_log.txt"
                    commandBuilder.append " -buildTarget $BUILD_TARGET"
                    commandBuilder.append " -BuildNumber $BUILD_ID"
                    commandBuilder.append " -OutputPath $OUTPUT_PATH"
                    commandBuilder.append " -buildKind $BUILD_KIND"

                    sh(script:commandBuilder.toString(), returnStdout:false)
                }
            }
        }
        stage('Xcode') {
            steps {
                sh """
                xcodebuild -project "$OUTPUT_PATH"/Unity-iPhone.xcodeproj \
                -configuration Release \
                clean archive -archivePath "$OUTPUT_PATH"/Archive \
                -scheme Unity-iPhone
                """
            }
        }
        stage('Export') {
            steps {
                sh """
                xcodebuild -project "$OUTPUT_PATH"/Unity-iPhone.xcodeproj \
                -exportArchive -archivePath "$OUTPUT_PATH"/archive.xcarchive \
                -exportPath "$OUTPUT_PATH"/Export \
                -exportOptionsPlist "$EXPORT_PLIST_DIR"/ExportOptions_"$BUILD_KIND".plist
                """
            }
        }
        stage('ipa保存') {
            steps {
                // ipaファイルの保存
                archiveArtifacts artifacts: "$APP_OUTPUT_PATH",
                fingerprint: true,
                followSymlinks: false
            }
        }
        stage('version情報の取得') {
            steps {
                script {
                    def ver_script = $/eval "unzip -p "${APP_OUTPUT_PATH}" Payload/"${IPA_EXECUTABLE_NAME}".app/Info.plist | plutil -convert json -o - -- - | jq -r .CFBundleShortVersionString"/$
                    println ver_script
                    VERSION = sh(script:"${ver_script}", returnStdout: true)
                    echo "version=${VERSION}"
                }
            }
        }
        stage('Deploy') {
            steps {
                retry(3) {
                    appCenter apiToken: "$APPCENTER_API_TOKEN",
                        ownerName: "$APPCENTER_OWNER",
                        appName: "$APPCENTER_APPNAME",
                        branchName: '',
                        buildVersion: "$VERSION",
                        commitHash: '',
                        distributionGroups: "$APPCENTER_GROUPS",
                        mandatoryUpdate: false,
                        notifyTesters: true,
                        pathToApp: APP_OUTPUT_PATH,
                        pathToDebugSymbols: '',
                        pathToReleaseNotes: '',
                        releaseNotes: "ビルド${BUILD_ID} ${USERNAME} / RELEASE NOTE: ${RELEASENOTE}"
                }
            }
        }
        // stage('Asset push') {
        //     when {
        //         expression {
        //            return params.UPLOAD_ASSETS
        //         }
        //     }
        //     steps{
        //         script{
        //             def comment = "[chore][jenkins] update ${BUILD_TARGET} addressables_content_state"
        //             sh """
        //             echo 'git add -A'
        //             git add -A ./Assets/AddressableAssetsData/${BUILD_TARGET}/addressables_content_state.bin
        //             echo 'git commit -m $comment'
        //             git commit -m "$comment"
        //             git clean -fd
        //             git reset .
        //             git checkout .
        //             git fetch origin $BRANCH
        //             git pull origin $BRANCH
        //             git status
        //             """

        //             withCredentials([gitUsernamePassword(credentialsId: "$GIT_CREDENTIAL", gitToolName: 'git-tool')]) {
        //                 sh 'git push -u origin $BRANCH'
        //             }

        //         }
        //     }
        // }
    }
    post {
        success {
            script {
                // Slack投稿用にブランチのログを取得
                GIT_LOG=sh(script: "git log origin/$BRANCH --pretty=short -1", returnStdout: true)
            }
            slackSend channel:"$SLACK_CHANNEL",
                teamDomain: "$SLACK_DOMAIN",
                color: "good",
                message: ":kirby::tada:*ビルド成功 [$JOB_NAME:$BUILD_ID]*:tada::kirby:\n$BUILD_URL\nユーザー : $USERNAME\nbranch : $BRANCH \n$GIT_LOG\n--------------------\n[ReleaseNote]\n$RELEASENOTE\n[<https://appcenter.ms/orgs/$APPCENTER_OWNER/apps/$APPCENTER_APPNAME/|Install App>]"
        }
        failure {
            slackSend channel:"$SLACK_CHANNEL",
                teamDomain: "$SLACK_DOMAIN",
                color: "danger",
                message: ":skull:*ビルド失敗 [$JOB_NAME:$BUILD_ID]*:skull:\n$BUILD_URL\nユーザー : $USERNAME\nbranch : $BRANCH"
        }
        aborted {
            slackSend channel:"$SLACK_CHANNEL",
                teamDomain: "$SLACK_DOMAIN",
                color: "warning",
                message: ":construction:*ビルド中断 [$JOB_NAME:$BUILD_ID]*:construction:\n$BUILD_URL\nユーザー : $USERNAME\nbranch : $BRANCH"
        }
        always {
            // ログ保存
            archiveArtifacts allowEmptyArchive: true,
            artifacts: "Logs/build_${BUILD_ID}_log.txt, Logs/assetbuild_${BUILD_ID}_log.txt",
            fingerprint: true,
            followSymlinks: false
        }
    }
}
